import React from 'react'
import { useState } from 'react'

const Join = () => {

   const[newinput, setnewinput] = useState({
     firstName: '',
     lastName: '',
     createid:'',
     password:'',
     cpassword:'',
     mobile:''
   })

   const inputChange = (e) => {
             const{name, value} = e.target; 
       
          setnewinput((previnput) =>{
               return{
                 ...previnput,
                 [name]: value
               }
          })
   }


    return (
        <>
          <div className='login'>
            <div className='main_inputs' onChange={inputChange}>
                  <input type='text' placeholder='First Name' value={newinput.firstName} name='firstName'/><br />
                  <input type='text' placeholder='Last Name' value={newinput.lastName} name='lastName' /><br />
                  <input type='text' placeholder='Create UserId' value={newinput.createid} name='createid' /><br />
                  <input type='password' placeholder='Create Password' value={newinput.password} name='password' /><br />
                  <input type='password' placeholder='Confirm Password' value={newinput.cpassword} name='cpassword'/><br />
                  <input type='text' placeholder='Mobile No.' value={newinput.mobile} name='mobile'/><br />
                 <button>Join</button>
            </div>
          
          </div>
        </>
    )
}

export default Join
